import React from "react";
import Navigation from "../components/Navigation";
import styled from "styled-components";

const StyledBody = styled.div`
  background: linear-gradient(rgba(0, 0, 0, 0.3), rgba(0, 0, 0, 0.3)),
    url("./home_bg.png") no-repeat;
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  width: 100%;
  height: 100%;
  max-width: 1700px !important;
  margin-left: auto;
  margin-right: auto;
`;

const Resp = styled.div`
  @media screen and (min-width: 1700px) {
    width: 1700px;
  }
`;

const Home = () => {
  return (
    <StyledBody>
      <Resp>
        <div class="container">
          <div className="main">
            <Navigation />
            <div class="step">
              <div>
                <p>Welcome to</p>
              </div>
              <div>
                <h1>E-smart rentals charlotte</h1>
              </div>
            </div>
          </div>
        </div>
      </Resp>
    </StyledBody>
  );
};

export default Home;
